import React from 'react';
import Navigation from '../components/Navigation';

const Home = () => {
    return (
        <div className='home'>
           <Navigation/>
           <div className='homeContent'>
               <div className='content'>
                   <h2>Développeur fullstack</h2>
                   <div className='presentation'>
                        <p>Bonjour, <br/> Je suis étudiant en licence 3 Méthodes informatiques appliquées à la gestion de l’entreprise
                         (MIAGE) à l’Université de Bordeaux Science et Technologie de Talence. Je fais un stage d'une dur</p>
                   </div>
                   <div className='pdf'>
                       <a href='./media/CV.pdf' target='_blank'>Télécharger CV</a>
                   </div>
               </div>

           </div>

        </div>
    );
};

export default Home;
